import classes from './Header.module.css';
import img1 from '../images/forky.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons'
import { faPenToSquare } from '@fortawesome/free-solid-svg-icons'
import { faBookmark } from '@fortawesome/free-solid-svg-icons'
import Searcher from '../'

const glass = <FontAwesomeIcon className={classes.search} icon={faMagnifyingGlass} />
const recipe = <FontAwesomeIcon className={`${classes['icon-color']} ${classes.recipe}`} icon={faPenToSquare} />
const bookmark = <FontAwesomeIcon className={`${classes['icon-color']} ${classes.bookmarks}`} icon={faBookmark} />

function Header(){
    return (
        <div className={classes.header}>
            <img className={classes.image} src={img1} alt='forky'></img>
            <form className={classes.form}>
                <input className={classes.input} placeholder='Search your favorite recipe' type='text' id='site-search'></input>
                <button className={classes.button}>{glass} SEARCH</button>
            </form>
            <div className={classes['recipe-book-container']}>
                <h1 className={classes.recipe}>{recipe} ADD RECIPE</h1>
                <h1 className={classes.bookmarks}>{bookmark} BOOKMARKS</h1>
            </div>
        </div>
    );
}

export default Header;
